description:
Caroline Ray is babysitting for Mr. Blue. She thinks that he's such a DILF. Mr. Blue gets home and is ready to go to bed after a long day of work, but Caroline has other suggestions on how to help relieve the stress of a hard day's work. Mr. Blue is reluctant since he is married, but Caroline knows that his wife won't be home for a while. That's all the reassurance he needs as he throws her on the kitchen counter and starts banging away at her pussy.


